import React from 'react';

function Story() {
  return (
    <div className='w-full h-screen bg-white tex'>
    <div className='w-full py-56 bg-black'>
    <div className='max-w-screen-2xl mx-auto px-5 sm:px-10 py-40'> 
        <h1>Our</h1>
        <h1>Story</h1>
      </div>
    </div>
    </div>
  )
}

export default Story
